import React , {useState} from 'react' 

function Cimput(props){

    const [ nome , setNome ] = useState('Pedro')

    return(
        <>
        <h3>
            {nome}
        </h3>
        <input type="text" value={nome} onChange={e => setNome(e.target.value)}></input> 
        </>
    )
}

export default Cimput;
